import React, {Component} from 'react';
import NavbarDefault from './components/navbar/navbar_default';
import logo from './public/logo/logo_white.svg';

var images = []
var src = './public/photos';

class Portfolio extends Component {
  constructor(props) {
    super(props);


    this.getPhotos = this.getPhotos.bind(this);
    this.pinPhotos = this.pinPhotos.bind(this);
    this.pinPhoto = this.pinPhoto.bind(this);
  }

  componentDidMount() {
    images = this.getPhotos(require.context('./public/photos', false, /\.(png|jpe?g|svg)$/));
  }

  getPhotos(r) {
    return r.keys().map(r);
  }

  pinPhoto() {
    console.log("aaa");
    return <img className="img-fluid" src="" alt="aaa" />;
  }

  pinPhotos(images){
    return images.map(this.pinPhoto);
  }

  render() {
    return(
      <div className="container">
        <NavbarDefault />
        <div>
          {this.pinPhotos(images)}
        </div>
      </div>
    );
  }
}

export default Portfolio;
